import logo from "../assets/images/Image 18.png"

const Home = () => {
  return (
    <div>
      <section className="w-11/10 h-11/10">
        <img src={logo} alt="Logo"loading="lazy" />
      </section>
      <section className="flex flex-col justify-center items-center">
        <h1 className="text-5xl mb-6">Features Overview</h1>
        <p className="w-1/2 flex-wrap">Discover the powerful tools and resources available on Career Mentor Hub designed to accelerate your professional growth.</p>
      </section>
    </div>
  );
};

export default Home;
